//SPDX-License-Identifier:MIT
pragma solidity >=0.8.9;
contract TimeManager{
    address private feeAddress;
    address private owner;

    constructor(){
        owner=msg.sender;
    }

    event TransferOwnership(address currentOwner,address newOwner,uint256 transTime);

    event SetAirdropMes(uint256 _marketId,uint256 _clearingTime,address airdropToken);

    //空投信息
    struct airdropMes{
        uint256 marketId;
        uint256 clearingTime;
        address airdropToken;
    }

    mapping(uint256=>airdropMes)private _airdropMes;

    modifier onlyOwner{
        require(msg.sender==owner,"Not Owner");
        _;
    }

    //设置费用地址
    function setFeeAddress(address _feeAddress)external onlyOwner{
        feeAddress=_feeAddress;
    }

    //转移所有权
    function transferOwnership(address _newAddress)external onlyOwner{
        address oldOwner=owner;
        owner=_newAddress;
        emit TransferOwnership(oldOwner,_newAddress,block.timestamp);
    }

    //设置某个市场的清算时间和空投代币地址
    function airdropTokenMes(uint256 _marketId,uint256 _clearingTime,address airdropTokenAddress)external onlyOwner{
        _airdropMes[_marketId]=airdropMes({
            marketId:_marketId,
            clearingTime:_clearingTime,
            airdropToken:airdropTokenAddress
        });
        emit SetAirdropMes(_marketId,_clearingTime,airdropTokenAddress);
    }

    //得到费用地址
    function getFeeAddress()external view returns(address){
        return feeAddress;
    }
    
    //得到合约所有者
    function getOwner()external view returns(address){
        return owner;
    }

    //得到空投信息
    function getAirdropMes(uint256 _marketId)external view returns(airdropMes memory){
        return _airdropMes[_marketId];
    }

}

